package com.my.shortest_palindrome;

import java.util.ArrayList;
import java.util.List;

/**
 * Created by alex.bykovsky on 7/12/17.
 */
public class Solution {

	public static void main(String[] args) {
		System.out.println(new Solution().shortestPalindrome("a"));
		//a
		System.out.println(new Solution().shortestPalindrome("bb"));
		//bb
		System.out.println(new Solution().shortestPalindrome("ca"));
		//aca
		System.out.println(new Solution().shortestPalindrome("ba"));
		//aba
		System.out.println(new Solution().shortestPalindrome("dbbb"));
		//bbbdbbb
		System.out.println(new Solution().shortestPalindrome("bbbd"));
		//dbbbd
		System.out.println(new Solution().shortestPalindrome("abcbacba"));
		//abcabcbacba
		System.out.println(new Solution().shortestPalindrome("dbbbd"));
		//dbbbd
		System.out.println(new Solution().shortestPalindrome("dbbc"));
		//cbbdbbc
		System.out.println(new Solution().shortestPalindrome("aacecaaa"));
		//aaacecaaa
		System.out.println(new Solution().shortestPalindrome("abcd"));
		//dcbabcd
		System.out.println(new Solution().shortestPalindrome("abb"));
		//bbabb
		System.out.println(new Solution().shortestPalindrome("abbacd"));
		//dcabbacd
		System.out.println(new Solution().shortestPalindrome("babbbabbaba"));
		//ababbabbbabbaba
		System.out.println(new Solution().shortestPalindrome("aabababababaababaa"));
		//aababaabababababaababaa

		long start = System.currentTimeMillis();
		System.out.println(new Solution().shortestPalindrome(""));
		System.out.println(System.currentTimeMillis() - start);
	}

	public String shortestPalindrome(String s) {

		int j = 0;
		for (int i = s.length() - 1; i >= 0; i--) {
			if (s.charAt(i) == s.charAt(j)) { j += 1; }
		}
		if (j == s.length()) { return s; }
		String suffix = s.substring(j);
		return new StringBuffer(suffix).reverse().toString() + shortestPalindrome(s.substring(0, j)) + suffix;
	}
}
